  \"Trends in cyanide solution concentrations and mine operations at gold mines in
  Nevada and their potential effects on cyanide-related mortality of vertebrates\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 10,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:27.093689\",\n\t\"name\": \"trends-in-cyanide-solution-concentrations-and-mine-operations-at-gold-mines-in-nevada-and-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Information on trends in practices at gold
  mines in Nevada using CN extraction technology and its relation to mortality of
  vertebrates, especially birds, was needed to assess current risks to these Fish
  and Wildlife Service trust resources in Nevada. The objectives of the study were
  as follows: (1) Determine pH and biologically available CN concentrations at the
  inflow of selected ponds and CN concentrations in heap puddles; (2) observe bird
  activity in relation to CN concentrations; (3) compare trends in CN concentrations
  at ponds and on heaps in relation to those found in 1990 and 1991 (Henny et al.
  1994); and, (4) Determine the amount of puddling on the tops of heaps.\",\n\t\"license_title\":
